import React from 'react'
import PropTypes from 'prop-types'
import styled from 'styled-components'
import { socialMedia } from '../config.js'
import Icon from './icons/icon'

const StyledSocialList = styled.ul`
	display: flex;
	flex-direction: column;
	align-items: center;
	margin: 0;
	padding: 0;
	list-style: none;

	&:after {
		content: '';
		display: block;
		width: 1px;
		height: 90px;
		margin: 0 auto;
		background-color: var(--pri-back);
	}

	li {
		&:last-of-type {
			margin-bottom: 20px;
		}

		a {
			padding: 10px;

			&:hover. &:focus {
				transform: translateY(-3px);
			}

			svg {
				width: 20px;
				height: 20px;
			}
		}
	}
`

const Social = ({ isHome }) => (
	<StyledSocialList>
		{socialMedia &&
			socialMedia.map(({ url, name }, i) => (
				<li key={i}>
					<a href={url} aria-label={name}>
						<Icon name={name} />
					</a>
				</li>
			))}
	</StyledSocialList>
)

Social.propTypes = {
	isHome: PropTypes.bool
}

export default Social
